import { useContext } from "react"
import { LevelContext } from "./themeContext"

function Heading(value) {
    const level = useContext(LevelContext);
    if( level == 1)
        return <h1>Level = 1</h1>
    else
        return <h3>Level = {level}</h3>
}

export default Heading;
